import styled from 'styled-components';
import Link from 'next/link';

const Nav = () => (
  <Wrapper>
    <Link href="/events">
      <a>Events</a>
    </Link>
    <Link href="/announcements">
      <a>Announcements</a>
    </Link>
    <Link href="/learn">
      <a>Learn</a>
    </Link>
  </Wrapper>
);
const Wrapper = styled.nav`
display:flex;
align-items:baseline;
gap:8px;

`;
export default Nav;
